import React, { PureComponent } from "react";
import Reactotron from 'reactotron-react-js';
import TempChart from '../../components/chartList/tempChart.js'
import Button from '@material-ui/core/Button';
import './troopDashboard.css'

class TroopDashboard extends PureComponent {

    handleButtonClick = e => {
        const { value } = e.target;
    }

    render() {
        Reactotron.log('this.props Troops.js', this.props)
        return (
            <div className="container">
            <h1>Weather Dashboard</h1>
            <div className="buttonContainer">
                <Button
                    variant="contained" 
                    color="primary"
                    value="weekly"
                    onClick={this.handleButtonClick}
                >
                    Weekly
                </Button>
                <Button
                    variant="contained" 
                    color="primary"
                    value="monthly"
                    onClick={this.handleButtonClick}
                >
                    Monthly
                </Button>

            </div>
            <TempChart chartValues={this.props.chartValues} filteredValues={this.props.filteredValues}/>
        </div>
        )
    }
}

export default TroopDashboard;
